import React,{useState} from 'raect';
const MovieList = ()=>{
    const [movies,setMovies]=useState([
        {
            name:'bahubali the begining',
            price:'Rs 150',
            id:2016
        },
        {
            name:'bahubali the conclusion',
            price:'Rs 200',
            id:2018
        },
        {
            name:"Rangasthalam",
            price:'Rs 300',
            id:2019
        }
    ]);
    return(
        <div>
       {movies.map((movie) =>(
           <li>{movie.name}</li>
       ))}
       </div>
        );
}

export default MovieList
